import { optimizeLabelStack } from '../common/utils';
export function optimizeMarks(marks, reactUFOVersion) {
  return marks.map(({
    labelStack,
    time,
    ...others
  }) => ({
    ...others,
    labelStack: labelStack && optimizeLabelStack(labelStack, reactUFOVersion),
    time: Math.round(time)
  }));
}